- input: "TEXT\x1CC00161067\x1C.TEXT\x1C\x1CF3XA\x1CThis admendment responds to Items
    #6,#8.and #13 in the FEC letter dated February 13,2009.                                                                                                                         #6-a
    form H2 has been included                                                                                   #8-the
    purpose (description) has been included for all disbursements in Schedule  H4,
    Line 21(a).                                                                                                               #13-an
    itemization has been included for the disbursements reported on Schedule   H6
    Line 30(a)                                                                                                                Amendment
    #3 is  in response to FEC letter dated May 8,2009--                                  #1
    This activity in question has been changed to an allocation between Federal and
    Levin funds.  No candidate for a Federal office was identified.                                      #2
    The payments for 'insurance', 'salary', and 'withholding' are for employees who
    have spent less than 25% of their time on Federal Election Activity.                               #3
    This refund was actually from AT&T (our telephone services provider) which was
    deposited inadverntantly to our Non-federal account.  Because the original telephone
    service had been paid out of the Federal account, the refund amount was transferred
    to the Federal account from the Non-federal account.                                 #4
    The items have been re-categorized as Generic campaign act\n"
